CREATE TABLE stability_rank (
    cor_code BIGINT(20),
    cor_name TEXT,
    cor_type TEXT,
    current DOUBLE,
    equity DOUBLE,
    interest_coverage TEXT,
    debt TEXT,
    net_borrowing TEXT,
    quick DOUBLE,
    reserve TEXT,
    loans_to_deposit TEXT,
    securities_holding DOUBLE,
    asset_management DOUBLE,
    interest_coverage_multiple TEXT,
    score DOUBLE,
    tier TEXT,
    industry_id INT(11)
);

